import React from "react";
import { brandLogo, brandLink } from "./mockData";

const Logo = () => {
  return (
    <>
      <a href={brandLink}>
        <img
          className="mr-auto ml-auto sm:ml-0"
          src={`data:image/svg+xml;utf8,${brandLogo}`}
          alt="Company Logo"
        />
      </a>
    </>
  );
};

export default Logo;
